function XOR-Crypt {
    param (
        [string]$filePath,
        [byte]$key
    )
    
    if (-Not (Test-Path $filePath)) {
        return
    }

    $content = [System.IO.File]::ReadAllBytes($filePath)
    for ($i = 0; $i -lt $content.Length; $i++) {
        $content[$i] = $content[$i] -bxor $key
    }
    [System.IO.File]::WriteAllBytes($filePath, $content)
}

